import React from "react";

function FileTree({ nodes, onDelete }) {
  return (
    <ul>
      {nodes.map((node) => (
        <li key={node.file_id} style={{ marginBottom: "0.5rem" }}>
          <span>
            {node.mime_type === "application/vnd.google-apps.folder" ? (
              <strong>üìÅ {node.name}</strong>
            ) : (
              <span>üìÑ {node.name}</span>
            )}
          </span>
          <button
            onClick={() => onDelete(node.file_id)}
            style={{ marginLeft: "1rem", color: "red" }}
          >
            Delete
          </button>
          {node.children && node.children.length > 0 && (
            <FileTree nodes={node.children} onDelete={onDelete} />
          )}
        </li>
      ))}
    </ul>
  );
}

export default FileTree;
